#
# Complete the 'migratoryBirds' function below.
#
# The function is expected to return an INTEGER.
# The function accepts INTEGER_ARRAY arr as parameter.
#

def migratoryBirds(arr):
    bird_count = {}
    # Count occurrences of each bird type
    for bird in arr:
        if bird not in bird_count:
            bird_count[bird] = 1
        else:
            bird_count[bird] += 1

    # Find the bird type with the highest count, and if there's a tie, the smallest bird type
    max_count = max(bird_count.values())
    most_frequent_birds = [bird for bird, count in bird_count.items() if count == max_count]

    # Return the smallest bird type among the most frequent ones
    return min(most_frequent_birds)

